    function __fromToListEx(
        bytes32 from_,
        bytes32 to_,
        uint256[] memory delivery_,
        uint256 start_,
        uint256 count_
    ) private view returns (Solution[] memory out_) {
        uint256 startcount = 0;
        uint256 outcount = 0;
        uint256[] storage orderids = _fromtoorders[BytesAndKeccakLib.pureBytes32Bytes32(from_, to_)];

        uint len = orderids.length;
        if (count_ == 0) count_ = len;
        out_ = new Solution[](count_);

        for (uint256 i = 0; i < len; i++) {
            if (outcount >= count_) break;
            Order.Info storage order = _orders[orderids[i]];
           if (
                (Order.isExpired(order) == 0 ||
                    Order.isExpired(order) >= block.timestamp) &&
                Delivery(rep.get(DELIVERY)).orderDeliveryCompatible(order, delivery_)
            ) {
                startcount++;
                if (startcount <= start_) continue;
                Order.InfoPublic memory _orderpub = __order(orderids[i], true);
                if (_orderpub.qty < _orderpub.granularity) continue;
                out_[outcount].orderid = _orderpub.orderid;
                out_[outcount].addr = _orderpub.to;
                out_[outcount].granularity = _orderpub.granularity;
                out_[outcount].qty = _orderpub.qty;
                out_[outcount].quote = _orderpub.quote;
                outcount++;
            }
        }
        assembly {
            mstore(out_, outcount)
        }
    }

