    function search(
        bytes32 from_,
        bytes32 to_,
        SearchPublicArgs memory args_,
        uint256[] memory delivery_
    )
        public
        view
        returns (
            Solution[] memory,
            uint256,
            Quote memory
        )
    {
        uint len = delivery_.length;
        require(len <= 32, "delivery array max size is 32");

        // stack to deep hack
        uint256[40] memory args;
        args[0] = args_.granularity;
        args[1] = args_.qty;
        args[2] = args_.qtyismin ? 1 : 0;
        args[3] = args_.qtyismax ? 1 : 0;
        args[4] = args_.maxtotal;
        args[5] = args_.maxquote;
        args[6] = args_.maxavgquote;
        args[7] = args_.maxcount;
        {
