        );
        _return(_result);
    }

    /**
     * @dev we search for direct solution from_ to target_.addr
     * from_ is the source currency , from_ directly filtered by fromToListEx
     * target_
     *      target_.addr                    is the searched dest currency
     *                                          addr is directly filtered by fromToListEx
     *      target_.mingranularity          is the minimum granularity we are searching for
     *                                          is used by the first filter
     *      target_.qty                     is the qty we are search, it can be overshoot is cheaper to buy more
     *      target_.delivery                is the filter for target delivery
     *                                          delivery is directly filtered by fromToListEx
     * searcharg_
     *      searcharg_.maxquote                 is used by the first filter
     *      searcharg_.maxavgquote
     *      searcharg_.maxcount
     *      searcharg_.used                 memorize the used of order
     *      searcharg_.remainer IGNORED     should be removed from target_.qty before call
     */
    function __search(
        bytes32 currency_,
        SearchArgTarget memory target_,
        SearchArg memory searcharg_,
        bool rawoutput_
    )
        private
        view
        returns (
            Solution[] memory out_,
            uint256 qty_,
            Quote memory quote_
        )
    {
        // get all orders fromTo
        out_ = __fromToListEx(
            currency_,
            target_.currency,
            target_.delivery,
            0,
            0
        );
        // filters max quote and mingranularity
        {
            uint len = out_.length;
            Solution[] memory filtered = new Solution[](len);
            uint256 count = 0;
            for (uint256 i; i < len; i++) {
                //testing maxquote
                require(out_[i].addr == target_.currency,"__search out_[i].addr == target_.currency");
                if (
                    (searcharg_.maxquote != 0) &&
                    (out_[i].quote > searcharg_.maxquote)
                ) continue;
                if (out_[i].granularity < target_.mingranularity) continue;
                //if (out_[i].qty < out_[i].granularity) continue;
                if (out_[i].qty < searcharg_.used.getIdQty(out_[i].orderid))
                    continue;
                if (
                    (out_[i].qty - searcharg_.used.getIdQty(out_[i].orderid)) <
                    out_[i].granularity
                ) continue;
                if (
                    target_.maxcount == 1 &&
                    searcharg_.maxavgquote != 0 &&
                    out_[i].quote > searcharg_.maxavgquote
                ) continue;

                filtered[count] = out_[i];
                count++;
            }
            assembly {
                mstore(filtered, count)
            }
            out_ = filtered;
        }

        /*out_ = out_.orderGranularity();
        if (target_.qty != 0 && target_.qtyismin && (!target_.qtyismax))
        {
            target_.qty = MarketSearchLib.recurseSearchBestQty(
                out_,
                0,
                target_,
                searcharg_,
                0
            );
        }*/
        //return (out_, target_.qty, quote_);
        (out_, qty_, quote_) = MarketSearchLib.recurseSearch(
            out_,
            0,
            target_,
            searcharg_,
            new Solution[](0)
        );
        if (!rawoutput_) {
            // aplying searcharg_.maxcount
            out_ = out_.order();
            if (target_.maxcount != 0 && out_.length > target_.maxcount) {
                uint256 count = target_.maxcount;
                assembly {
                    mstore(out_, count)
                }
                (qty_, quote_) = out_.getQtyQuote();
            }
        }
    }

