    function __searchCFollowPath(
        bytes32[] memory path_,
        MarketSearch.SearchArgTarget memory target_,
        MarketSearch.SearchArg memory searcharg_,
        Remainer[] memory remainer_
    ) private view returns (SolutionSet memory out_) {
        //uint len = path_.length;
        require(path_.length >= 2, "__searchCFollowPath path_.length>=2");
        require(path_[path_.length - 1]==target_.currency, "__searchCFollowPath path_[path_.length - 1]==target_.currency");

        Solution[] memory solutions;
        SolutionSetDesc memory desc;

        if (path_.length==2)
        {
            // no swap ->direct offer
            (solutions, desc.qty, desc.quote) = __search(
                path_[path_.length - 2],
                target_,
                searcharg_,
                false
            );
            desc.count = solutions.length;
            desc = desc.descCreateFromTo(
                path_[path_.length - 2],
                target_.currency
            );
        }
        else
        {
            // get total swap qty
            uint256 total = searcharg_.maxtotal; //+remainer_.get(path_[0]);
            for (uint256 i = 1; i < path_.length - 1; i++) {
                uint256 swapqty;
                //Quote memory swapquote;
                (, swapqty, ) = __search(
                    path_[i - 1],
                    MarketSearch.SearchArgTarget(
                        path_[i],
                        0,
                        0,
                        false,
                        false,
                        0,
                        new uint256[](0) //TODO only virtual
                    ),
                    MarketSearch.SearchArg(0, 0, total, searcharg_.used),
                    true
                );
                if (swapqty == 0) return out_;
                total = swapqty +remainer_.get(path_[i]);
            }

            //get target 
            // searcharg.maxquote ignored
            // searcharg.maxavgquote ignored
            {
                (solutions, desc.qty, desc.quote) = __search(
                    path_[path_.length - 2],
                    target_,
                    MarketSearch.SearchArg(0, 0, total, searcharg_.used),
                    false
                );
            }
            if (desc.qty == 0) return out_;

            //creating set
            {
                desc.count = solutions.length;
                desc = desc.descCreateFromTo(
                    path_[path_.length - 2],
                    target_.currency
                );
            }
            // treating swaps
            total = (desc.qty*desc.quote.quoteavg) / 10**18; 
            for (uint256 i = path_.length - 2; i >0 ; i--) 
            {
                Solution[] memory swapsolutions;
                SolutionSetDesc memory swapdesc;
                {
                    MarketSearch.SearchArgTarget memory target;
                    MarketSearch.SearchArg memory search;
                    {
                        //target = MarketSearch.SearchArgTarget(
                        //    path_[i],
                        //    0,
                        //    total-remainer_.get(path_[i - 1]),
                        //    true,
                        //    false,
                        //    0,
                        //    new uint256[](0) //TODO only virtual
                        //);
                        //require(total>0,"total>0");
                        target.currency = path_[i];
                        target.qty = total - remainer_.get(path_[i]);
                        //if (i>1)
                        //    target.qty -= remainer_.get(path_[i - 1]);
                        target.qtyismin = true;
                        //search = MarketSearch.SearchArg(0, 0, 0, searcharg_.used);
                        search.used = searcharg_.used;
                    }

                    (swapsolutions, swapdesc.qty, swapdesc.quote) = __search(
                        path_[i - 1],
                        target,
                        search,
                        false
                    );
                }
                if (swapdesc.qty == 0) return out_;
                total = (swapdesc.qty*swapdesc.quote.quoteavg) / 10**18; 

                (desc, solutions) = desc.descAddOffset(solutions,path_[i - 1],swapsolutions);
                desc.quote.quotemin = (desc.quote.quotemin*swapdesc.quote.quotemin)/10**18;
                desc.quote.quotemax = (desc.quote.quotemax*swapdesc.quote.quotemax)/10**18;
                desc.quote.quoteavg = (desc.quote.quoteavg*((swapdesc.qty*swapdesc.quote.quoteavg)/desc.qty))/10**18;
            }

            //resulting out
        }
        out_ = out_.add(desc, solutions);
    }

    function __searchC(
        bytes32 from_,
        MarketSearch.SearchArgTarget memory target_,
        MarketSearch.SearchArg memory searcharg_,
        Remainer[] memory remainer_
    ) private view returns (SolutionSet memory out_,Remainer[] memory remainerout_) {
        remainerout_ = remainer_;
        SolutionSet memory solpath;
        {
            bytes32[][] memory paths = _listPath(from_, target_.currency);
            uint len = paths.length;
            for (uint256 i; i < len; i++) {
                SolutionSetDesc memory desc;
                (, desc.qty, desc.quote) = __search(
                    paths[i][paths[i].length - 2],
                    target_,
                    MarketSearch.SearchArg(0, 0, 0, searcharg_.used),
                    false
                );
                if (desc.qty == 0) continue;
                desc.path = paths[i];
                solpath = solpath.add(desc, new Solution[](0));
            }
        }
        uint pathlen = solpath.descs.length;
        if (pathlen==0)
            return (out_,remainerout_);
        //return (solpath,remainerout_);

        SearchArgTarget memory target;
        {
            target.currency = target_.currency;
            target.mingranularity = target_.mingranularity;
            target.qty = target_.qty;
            target.qtyismin = target_.qtyismin;
            target.qtyismax = target_.qtyismax;
            target.maxcount = target_.maxcount; 
            target.delivery = target_.delivery;
        }
        SearchArg memory searcharg;
        {
            searcharg.maxquote = searcharg_.maxquote;
            searcharg.maxavgquote = searcharg_.maxavgquote;
            searcharg.maxtotal = searcharg_.maxtotal;
            searcharg.used = searcharg_.used;
        }
        SolutionSet[] memory pathsolutions = new SolutionSet[](pathlen);

        uint maxcount;
        while (true)
        {
            searcharg.maxquote = searcharg_.maxquote;
            target.maxcount = 1;
            for (uint i; i < pathlen; i++) {
                pathsolutions[i] = __searchCFollowPath(
                    solpath.descs[i].path,
                    target,
                    searcharg,
                    remainerout_
                );
                require(pathsolutions[i].descs.length<=1,"PARANOIA __searchCFollowPath should return max 1 desc");
            }

            uint quotebest=type(uint).max;
            {
                uint256 quotemin;
                uint256 quotemax;


                for (uint i; i < pathlen; i++) {
                    if (pathsolutions[i].qty==0)
                        continue;

                    if (quotebest==type(uint).max || quotemin>pathsolutions[i].quote.quotemin)
                    {
                        if (quotebest!=type(uint).max && quotemin<pathsolutions[i].quote.quotemax)
                            quotemax = quotemin;
                        else
                            quotemax = pathsolutions[i].quote.quotemax;
                        quotebest = i;
                        quotemin = pathsolutions[i].quote.quotemin;
                    }
                    else if (quotemax>pathsolutions[i].quote.quotemin)
                        quotemax = pathsolutions[i].quote.quotemin;
                }
                if (quotebest==type(uint).max)
                {
                    //require(false,"if (quotebest==type(uint).max)");
                    break;
                }

                searcharg.maxquote = quotemax; 
            }
            SolutionSet memory selected;
            //if (searcharg.maxquote>=pathsolutions[quotebest].quote.quotemax)
            //    selected = pathsolutions[quotebest];
            //else
            {
                selected = __searchCFollowPath(
                    solpath.descs[quotebest].path,
                    target,
                    searcharg,
                    remainerout_
                );
                require(selected.descs.length==1,"PARANOIA __searchCFollowPath should return 1 desc");
            }
            if (selected.qty ==0)
            {
                require(false,"if (selected.qty ==0)");
                break;
            }
            out_ = out_.add(selected);
            maxcount +=selected.solutions.length;
            if (selected.descs[0].offset.length!=0)
                maxcount -= selected.descs[0].offset[selected.descs[0].offset.length-1];
            remainerout_ = remainerout_.update(selected.descs[0],selected.solutions);

            searcharg.used = searcharg.used.add(selected.solutions);
            searcharg.maxquote = searcharg_.maxquote;


            if (target_.maxcount!=0)
            {
                if (maxcount>=target_.maxcount)
                {
                    require(false,"if (maxcount>=target_.maxcount)");
                    break;
                }
                target.maxcount = target_.maxcount-maxcount;
            }
            if (target_.qty!=0)
            {
                if (selected.qty>=target_.qty)
                {
                    require(false,"if (selected.qty>=target_.qty)");
                    break;
                }
                target.qty = target_.qty-selected.qty;
            }
            if (searcharg_.maxtotal!=0)
            {
                uint256 total = (out_.qty*out_.quote.quoteavg)/10**18;
                if (total>=searcharg_.maxtotal)
                {
                    require(false,"if (total>=searcharg_.maxtotal)");
                    break;
                }
                searcharg.maxtotal = searcharg_.maxtotal-total;
            }
            if (searcharg_.maxavgquote!=0)
            {
                /*if (
                    searcharg_.maxavgquote != 0 &&
                    in_[i].quote > searcharg_.maxavgquote
                ) {
                    uint256 deltaqty = ((((stack.getQty(stackcount) *
                        searcharg_.maxavgquote) / 10**18) -
                        stack.getTotal(stackcount)) * 10**18) /
                        (in_[i].quote - searcharg_.maxavgquote);

                    if (qty > deltaqty)
                        qty = deltaqty - (deltaqty % in_[i].granularity);
                }*/

            }
            //break;

        }


    }
